      var tipo = 0; // patron del tipo de placa A - ok!\n\n      patron = /^[1-9][0-9]{2}[A-Z]{3}$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(0, 3)) > 99) {\n        tipo = 'A';\n      } // patron del tipo de placa B - ok!\n\n\n      patron = /^[1-9][0-9]{3}[A-W][A-Z]$/;\n\n      if (patron.test(placa) && placa.length == 6) {\n        tipo = 'B';\n      } // patron del tipo de placa C - ok!\n\n\n      patron = /^[1-9][A-Z]{3}$/;\n\n      if (patron.test(placa) && placa.length == 4) {\n        tipo = 'C';\n      } // patron del tipo de placa D - ok!\n\n\n      patron = /^[A-Z][0-9]{4}$/;\n\n      if (patron.test(placa) && placa.length == 5 && parseFloat(placa.substr(1, 4)) > 0) {\n        tipo = 'D';\n      }\n\n      patron = /^[0-9]\\d+$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa) >= 400001 && parseFloat(placa) <= 500000) {\n        tipo = 'D';\n      } // patron del tipo de placa E - AUTO DE ALQUILER - ok!\n\n\n      patron = /^[0-9]\\d+$/;\n\n      if (patron.test(placa) && placa.length == 7 && parseFloat(placa) >= 10001 && parseFloat(placa) <= 9999999) {\n        tipo = 'E';\n      } // patron del tipo de placa E - COLECTIVO (METROPOLITANO) - ok!\n\n\n      patron = /^[0-9]{3}[N][A][0-9]{3}[C|M]$/;\n\n      if (patron.test(placa) && placa.length == 9 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[0-9]{3}[N][A][0-9]{3}$/;\n\n      if (patron.test(placa) && placa.length == 8 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[0-9]{3}[T][L][0-9]{3}[C|M]$/;\n\n      if (patron.test(placa) && placa.length == 9 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[0-9]{3}[T][L][0-9]{3}$/;\n\n      if (patron.test(placa) && placa.length == 8 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[0-9]{3}[N][Z][0-9]{3}[C|M]$/;\n\n      if (patron.test(placa) && placa.length == 9 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[0-9]{3}[N][Z][0-9]{3}$/;\n\n      if (patron.test(placa) && placa.length == 8 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[0-9]{3}[E][C][0-9]{3}[C|M]$/;\n\n      if (patron.test(placa) && placa.length == 9 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[0-9]{3}[E][C][0-9]{3}$/;\n\n      if (patron.test(placa) && placa.length == 8 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[0-9]{3}[C][H][0-9]{3}[C|M]$/;\n\n      if (patron.test(placa) && placa.length == 9 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[0-9]{3}[C][H][0-9]{3}$/;\n\n      if (patron.test(placa) && placa.length == 8 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[0-9]{3}[T][X][0-9]{3}[C|M]$/;\n\n      if (patron.test(placa) && placa.length == 9 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[0-9]{3}[T][X][0-9]{3}$/;\n\n      if (patron.test(placa) && placa.length == 8 && parseFloat(placa.substr(0, 3)) > 0 && parseFloat(placa.substr(5, 3)) > 0) {\n        tipo = 'E';\n      } // patron del tipo de placa E - TAXI SIN ITINERARIO - ok!\n\n\n      patron = /^[L][0-9]{5}$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(1, 5)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[A][0-9]{5}$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(1, 5)) > 0) {\n        tipo = 'E';\n      } // patron del tipo de placa E - TAXI DE SITIO - ok!\n\n\n      patron = /^[S][0-9]{5}$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(1, 5)) > 0) {\n        tipo = 'E';\n      }\n\n      patron = /^[B][0-9]{5}$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(1, 5)) > 0) {\n        tipo = 'E';\n      } // patron del tipo de placa F - CARGA GENERAL - ok!\n\n\n      patron = /^[0-9]\\d+$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa) >= 200001 && parseFloat(placa) <= 300000) {\n        tipo = 'F';\n      } // patron del tipo de placa H - OMNIBUS URBANO DE PASAJEROS\n\n\n      patron = /^[0-9]\\d+$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa) >= 300001 && parseFloat(placa) <= 400000) {\n        tipo = 'H';\n      } // patron del tipo de placa I - DIPLOMATICOS - ok!\n\n\n      patron = /^[A-Z]{3}[0-9]{3}$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(3, 3)) > 0) {\n        tipo = 'I';\n      }\n\n      patron = /^[0-9]{2}[A-Z]{2}$/;\n\n      if (patron.test(placa) && placa.length == 4 && parseFloat(placa.substr(0, 2)) > 0) {\n        tipo = 'I';\n      } // patron del tipo de placa J - DEMOSTRADORAS - ok!\n\n\n      patron = /^[Y-Z][K-Z][0-9]{2}$/;\n\n      if (patron.test(placa) && placa.length == 4 && parseFloat(placa.substr(2, 2)) > 0) {\n        tipo = 'J';\n      }\n\n      patron = /^[1-9][Y-Z][K-Z][0-9]{2}$/;\n\n      if (patron.test(placa) && placa.length == 5 && parseFloat(placa.substr(3, 2)) > 0) {\n        tipo = 'J';\n      } // patron del tipo de placa K - AUTO ANTIGUO - ok!\n\n\n      patron = /^[C][A-Z][0-9]{3}$/;\n\n      if (patron.test(placa) && placa.length == 5 && parseFloat(placa.substr(2, 3)) > 0) {\n        tipo = 'K';\n      } // patron del tipo de placa L - S.P.F. CARGA - ok!\n      //patron=/^[0-9]{2}[1-9][A-E][A-L][1-9]$/ Jose Luis cardenas idico el rengo correcto \n\n\n      patron = /^[0-9]{3}[A][A-Z][1-9]$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(0, 3)) > 0) {\n        tipo = 'L';\n      }\n\n      patron = /^[0-9]{3}[B][A-Z][1-9]$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(0, 3)) > 0) {\n        tipo = 'L';\n      }\n\n      patron = /^[0-9]{3}[C][A-Z][1-9]$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(0, 3)) > 0) {\n        tipo = 'L';\n      }\n\n      patron = /^[0-9]{3}[D][A-Z][1-9]$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(0, 3)) > 0) {\n        tipo = 'L';\n      }\n\n      patron = /^[0-9]{3}[E][A-L][1-9]$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(0, 3)) > 0) {\n        tipo = 'L';\n      } // patron del tipo de placa M - SERV. PUB. FED. PASAJE - ok!\n\n\n      patron = /^[0-9]{3}[H-L][A-Z][1-9]$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(0, 3)) > 0) {\n        tipo = 'M';\n      } // patron del tipo de placa N - SERV. PUB. FED. TURISMO - ok!\n\n\n      patron = /^[0-9]{3}[R][A-Z][1-9]$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(0, 3)) > 0) {\n        tipo = 'N';\n      } // patron del tipo de placa P - S.P.F. ARREND. PARTICULAR - ok!\n\n\n      patron = /^[0-9]{3}[F-G][A-Z][1-9]$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(0, 3)) > 0) {\n        tipo = 'P';\n      } // patron del tipo de placa Q - S.P.F. ARREND. PASAJE - ok!\n\n\n      patron = /^[0-9]{3}[M][A-Z][1-9]$/;\n\n      if (patron.test(placa) && placa.length == 6 && parseFloat(placa.substr(0, 3)) > 0) {\n        tipo = 'Q';\n      } // patron del tipo de placa R - S.P.F. ARREND. TURISMO - ok!\n\n\n      patron = /^[0-9]{